import React from 'react';
import styled from 'styled-components';
import { useSelector, useDispatch } from 'react-redux';
import { selectResult } from './searchSlice';

const ResultContainer = styled`
    width: 100vw;
    margin: 0px 30px 0px 30px;
`
const Results = () => {
    const results = useSelector(selectResult);

    function loadResults(){
        var r = [];
        results.Search.map((value, i) => (
            r.push(
                <div key={i}>
                    <span style={{margin:"10px 20px 10px 15px", wordWrap: "break-word",width: "100%"}}>{value.Title}</span>
                </div>
            )
        ));
        return r;
    }
    return(
        <div>
            {
                results.Response === 'True'
                ?
                loadResults()
                :
                "No results"
            }
        </div>
    );
}

export default Results;
